import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      datas: []
    }
  }


  componentDidMount() {
    fetch('https://gist.githubusercontent.com/Salaidevaganamani/506b059aa029b018e04a8e88f2cfce83/raw/aa96f3f09412276d62cf3b49b00ce6d23d19a0a0/dummy.json')
    .then((response) => {
      return response.json();
    })
    .then((myJs) => {
      const values = JSON.stringify(myJs);
      this.setState({datas: values});
      console.log(this.state.datas);
    })
  }

  render() {
    return (
      <div className="App">
        <p>Salai Deva</p>

      </div>
    );
  }
}

export default App;
